CREATE TABLE W_LEASE_ (
ID NUMBER NOT NULL ENABLE,
LEASE_ID VARCHAR2(255) NOT NULL ENABLE,
BLOCK_TYPE VARCHAR2(255),
NELP_ROUND VARCHAR2(255),
MINISTRY_REFERENCE_NO VARCHAR2(255),
LEASE_NUMBER VARCHAR2(255),
STATE_NAME VARCHAR2(255),
PROJECT VARCHAR2(255),
BLOCK_NAME VARCHAR2(255),
EFFECTIVE_DATE DATE,
EXT_YEAR NUMBER,
REMARKS VARCHAR2(255),
INSERT_DATE DATE,
INSERT_USER VARCHAR2(255),
UPDATE_DATE DATE,
UPDATE_USER VARCHAR2(255),
AREA_ID NUMBER NOT NULL ENABLE,
  CONSTRAINT "W_LEASE_PK" PRIMARY KEY ("ID"),
  CONSTRAINT "W_AREA_FK" FOREIGN KEY ("AREA_ID") REFERENCES W_AREA_("ID")
);

